script: |
  super -f text -I q10212.spq | sort > q10212.out

inputs:
  - name: q10212.spq
    data: |
      SELECT DISTINCT col0 * + 85 + col0 - 14 + + - col0 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + 19 + + - col2 / 60 + - - col0 + + - 59 IS NOT NULL;
  - name: tab1

outputs:
  - name: q10212.out
    data: |
